INSERT INTO bookstore.review (id, user_id, book_id, edit_time, title, content, rating) VALUES (1, 1, 1, '2018-06-20 00:00:00', '我读追风筝的人', '为什么忠诚善良的人反而遭到这样的结局，面对阿米尔的污蔑，他和阿里选择离去。当房屋需要他时，他又毅然决然的选择坚守，为了阿米尔能够得到父亲的赞许，哈桑却受到那样的凌辱，换来的却是懦弱的阿米尔的回避，身份，阶级，好可笑的头衔，生命与忠诚在那些虚无的名誉不值一提。犹如草芥浮萍....', 5);
